import Cards from '../mainPage/LandingItems/testimonials/Cards.js';

function ProductHolder(props)
{
    return(
        <div className="App">
            <a href={props.link} target="_blank">
                <div style="background-image: url({props.imageUrl});">
                </div>
            </a>            
        </div>
    );
}

export default ProductHolder;
